(7732060, '河北', '本科批', '物理', '化', '2006', '06', '唐山师范学院', '01', '电子信息科学与技术', '(国际本科学术互认课程项目)(国际本科学术互认课程项目)本科学术互认课程（ISEC）项目专业属于高收费专业，与美国、英国、澳大利亚、新西兰等国家多所高校对接，采取“2+X”或“4+0”模式培养，国内学费为每生每年23000元。在国（境）外学习阶段学费按国（境）外合作院校的收费标准由境外院校收取，请考生报考前务必咨询高校或查看高校章程，以免影响入学', 2024, 0, 0),
(7721031, '河北', '本科批', '历史', '不限', '2007', '07', '唐山师范学院', '01', '物流管理', '(合作培养项目)(合作培养项目)我校与西南交通大学合作培养项目，学籍注册为唐山师范学院。学生在校期间不同学习时段分别在唐山师范学院和西南交通大学唐山研究院培养。合作培养学生在学校规定期限内达到所在专业毕业要求的，颁发唐山师范学院本科学历证书；符合学校学位授予条件，颁发唐山师范学院学士学位证书。合作培养的学生在西南交通大学唐山研究院培养期间修完全部课程且成绩合格的，可获得由西南交通大学出具加盖学校印章的合作培养证书，请考生报考前务必咨询我校或查看我校2024年招生章程，以免影响入学', 2024, 0, 0),
